Over America

Travel Documentary hosted by Tom Skerritt, published by PBS in 2010 - English narration


Information
------------------------------

Over America
In this breathtaking DVD, some of the greatest cinematographers and photographers working in the industry capture hours of footage of lush American landscapes and cityscapes from the unparalleled aerial perspective. The program flies viewers over such varied areas as New York, Washington D.C., Arizona, Florida, Over New England and Over California. If you enjoyed Visions of Europe you will enjoy this series.



2)  California 
Over California
A Magical Place you have never seen the Sierra Nevada Mountains and the Pacific Coastline like this before! Take to the skies for an exhilarating journey in the award-winning film Over California. Get a unique perspective on the vast and changing landscape of the Golden State through powerful high-altitude images that reveal California's unique beauty. Soar through blue skies, among ancient redwood forests, around snow-capped peaks, over deserts and coastline, and above glittering cities all set to an original soundtrack. Over California features rare views and stunning cinematography of the states most celebrated landscapes, from deserts to vineyards and everything in between, including Disneyland and the Golden Gate Bridge. Enjoy the imagery as you learn all about California s history and heritage.



